●【快適フィット設計】<br>
運動時の快適性を追及したパターンを採用。<br>
脇下を別パーツにする事により、運動時の突っ張り感を軽減。<br>
収まりの良い着用感で快適性も向上。<br>
生地の伸びの方向を、身体の動きにあわせて配置。圧迫感を感じさせない快適性を実現。 <br>
●【吸汗速乾・高ストレッチ】<br>
身生地には高い吸汗速乾性とストレッチ性のある東レ「ユニットスキン」を採用することで、より快適性を追求。<br>
●【フラットシーマ】<br>
身頃には肌あたりのフラットシーマ縫製を採用。着用時の違和感を軽減します。<br>
●【軽量化】<br>
生地の軽量化とパターン設計を見直すことで、従来比18%の軽量化を実現。<br>
<br>
■素材　ポリエステル92％　ポリウレタン8％
